import Card from "../UI/Card";
import classes from "./AvailableMeals.module.css";
import MealItem from "./MealItem/MealItem";
const DUMMYMEALS = [
  {
    id: "m1",
    name: "Sushi",
    descrpition: "Finest fish and veggies",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    descrpition: "A german speciality!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    descrpition: "American, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Green Bowl",
    descrpition: "Healthy and green",
    price: 18.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMYMEALS.map((meal) => (
    <MealItem
      key={meal.id}
      name={meal.name}
      descrpition={meal.descrpition}
      price={meal.price}
    />
  ));
  return (
    <section className={classes.meals}>
      <Card>
        <ul className={classes.meals}>{mealsList}</ul>
      </Card>
    </section>
  );
};
export default AvailableMeals;
